"/aktivitaeten/BDM-2024-09/87_09-2024.jpg",Ve="/aktivitaeten/BDM-2024-09/88_09-2024.jpg",xe="/aktivitaeten/BDM-2024-09/89_09-2024.jpg",Ie="/aktivitaeten/BDM-2024-09/90_09-2024.jpg",Ge="/aktivitaeten/BDM-2024-09/91_09-2024.jpg",Ue="/aktivitaeten/BDM-2024-09/92_09-2024.jpg",qe="/aktivitaeten/BDM-2024-09/93_09-2024.jpg";const Xe={},Ye=t("h1",{id:"bilder-des-monats-september-2024",tabindex:"-1"},[t("a",{class:"header-anchor",href:"#bilder-des-monats-september-2024","aria-hidden":"true"},"#"),e(" Bilder des Monats September 2024")],-1),Ze=t("p",null,"POTA Aktivierung von DB4SNK in DE-0035.",-1),ye=t("p",null,"Am sp\xE4ten Nachmittag bei gut 32 Grad und super Wetter fand ich mit dem Radel eine Sitzbank am Waldrand von Beuerbach. Der H\xFCgel in der N\xE4he wird Eisenk\xFCppel genannt. Gemeinde H\xFCnstetten. JO40CG Die Ausr\xFCstung war schnell aufgebaut, Yaesu FT817ND, Lipo Akku, Tablet und HF-P1 als Antenne. Dies wurde meine 1. FT8 POTA Aktion Auf dem 20m Band hatte ich nach langem testen ein paar FT8 Verbindungen im Log. ein Wechsel auf 40m brachte, trotz schlechterem Wirkungsgrad der Mini Antenne mehrere Verbindungen in FT8 und FT4. Nachdem ich die mindest Anzahl an QSO\xB4s erreicht hatte, wechselte ich noch auf SSB, wo ich aufgrund meiner QRP Ausr\xFCstung doch zu oft \xFCberh\xF6rt wurde. Fazit : Aktion gelungen mit ein paar Notizen was ich n\xE4chstes mal besser machen werde. -Sonnenschirm & Sonnencreme",-1),Je=t("p",null,[t("img",{src:p,alt:"Bilder des Monats"})],-1),$e=e("Zwischendurch ein Netz-Fund beim SWR (dem S\xFCdwestrundfunk, nicht dem Stehwellenverh\xE4ltnis): "),et={href:"https://www.swr.de/swraktuell/baden-wuerttemberg/suedbaden/gipfel-funker-im-schwarzwald-102.html",target:"_blank",rel:"noopener noreferrer"},tt=e("DF7TF beim SOTA im Schwarzwald"),at=e(". Im Text wurden leider (wie so h\xE4ufig) einige Begrifflichkeiten durcheinander gebracht. Das Video ist daf\xFCr um so sch\xF6ner anzusehen. Unaufgeregter Funkbetrieb in der Natur. Liebe Gr\xFC\xDFe an den OP Wolf, DF7TF. Bild: SWR, Screenshot aus dem Video."),it=r('<p><img src="'+_+'" alt="Bilder des Monats"></p><p>Heute unterwegs in NL-0018 mit dem Fahrrad</p><p><img src="'+l+'" alt="Bilder des Monats"><img src="'+m+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"></p>',3),rt=e("Am 08.09.2024 hat "),nt={href:"https://www.qrz.com/db/DK4HAA",target:"_blank",rel:"noopener noreferrer"},st=e("Harm, DK4HAA"),ot=e(" erfolgreich den "),dt={href:"https://pota.app/#/park/DE-0253",target:"_blank",rel:"noopener noreferrer"},pt=e("Teetzpark, DE-0253"),_t=e(" in Hamburg und gleichzeitig zwei Trails aktiviert. Hier verlaufen n\xE4mlich die Trails "),lt={href:"https://pota.app/#/park/DE-0604",target:"_blank",rel:"noopener noreferrer"},mt=e("Jakobsweg Via Baltica & Birgittaweg, DE-0604"),gt=e(" und "),ct={href:"https://pota.app/#/park/DE-0629",target:"_blank",rel:"noopener noreferrer"},ht=e("Hanseatenweg, DE-0629"),ut=e(" durch den Park, so dass direkt am Alsterlauf ein 3fer (drei sich \xFCberschneidende Park-Referenzen) entsteht. Die Alster flie\xDFt direkt durch den Park und kann mit Kanus und SUPs befahren werden. Ein ausgiebiges Wegenetz f\xFChrt durch diesen Mini-Dschungel mitten in Hamburg. Perfekt, um den Alltag hinter sich zu lassen und QRV im Gr\xFCnen zu sein."),vt=r('<p><img src="'+h+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"><img src="'+B+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"><img src="'+f+'" alt="Bilder des Monats"></p><p>Heute ging\u2019s mal wieder mobil zu einer Pota Aktivierung f\xFCr DL2MBN . Nach 56 Minuten waren 44 qsos im Kasten mit einer ampro20 Antenne dem ft891 50 Watt. 73 44</p><p><img src="'+b+'" alt="Bilder des Monats"><img src="'+w+'" alt="Bilder des Monats"><img src="'+j+'" alt="Bilder des Monats"></p>',3),Bt=e("Eine spontane Aktivierung am 21.09.2024 von "),kt={href:"https://www.qrz.com/db/DK4HAA",target:"_blank",rel:"noopener noreferrer"},Mt=e("Harm, DK4HAA"),Dt=e(" vom "),ft={href:"https://pota.app/#/park/DE-0261",target:"_blank",rel:"noopener noreferrer"},bt=e("Th\xF6rls Park, DE-0261"),wt=e(" sowie den beiden Trails "),jt={href:"https://pota.app/#/park/DE-0622",target:"_blank",rel:"noopener noreferrer"},St=e("Fernwanderweg E9, DE-0622"),At=e(" und "),Et={href:"https://pota.app/#/park/DE-0558",target:"_blank",rel:"noopener noreferrer"},Tt=e("Fernwanderweg E1, DE-0558"),zt=e(", um "),Pt={href:"https://www.qrz.com/db/DC1TC",target:"_blank",rel:"noopener noreferrer"},Ft=e("Tobias, DC1TC"),Ot=e(" zu hunten, der zu dieser Zeit von "),Nt={href:"https://pota.app/#/park/DE-0133",target:"_blank",rel:"noopener noreferrer"},Lt=e("Neuwerk, DE-0133"),Ht=e(" und "),Ct={href:"https://pota.app/#/park/DE-0104",target:"_blank",rel:"noopener noreferrer"},Wt=e("Hamburgisches Wattenmeer, DE-0104"),Kt=e(" Funkbetrieb gemacht hat. Insgesamt kamen an diesem sch\xF6nen Sp\xE4tsommernachmittag 14 QSOs auf 20 m und 40 m ins Log. Viele davon Drau\xDFenfunker2Drau\xDFenfunker. TRX: Lab599 TX-500 mit DIY599 PA500 Endstufe/Tuner. ANT: "),Rt={href:"https://draussenfunker.de/diy/teleskop-viertelwellen-vertical.html",target:"_blank",rel:"noopener noreferrer"},Qt=e("DF Teleskop Vertical"),Vt=r('<p><img src="'+S+'" alt="Bilder des Monats"><img src="'+A+'" alt="Bilder des Monats"><img src="'+E+'" alt="Bilder des Monats"></p><p>Was macht man im Urlaub im Erzgebirge? Nat\xFCrlich POTA !</p><p>Gerade noch rechtzeitig vor dem Urlaub hat meine YL Christiane nach 4 Wochen warten endlich ihr Wunschrufzeichen DN9CH.</p><p>Wir hatten schon einige Berge im S\xE4chsischen Bergwettbewerb aktiviert. Da funkt man in FM auf 145.425 / 430.150 / 1.297.50 MHz.</p><p>Samstag wollten wir uns dann auch mal an eine POTA Aktivierung im Urlaub wagen. Mit dabei ein ICOM IC T81 Handfunkger\xE4t ( 6m / 2m / 70cm / 23 cm ) und ein ICOM 705.</p><p>10 QSO auf UKW und Kurzwelle sollten an einem Samstag vom Fichtelberg klappen. Mit der Porti f\xFCr 2/70 und einer 10 Element Yagi f\xFCr 23 cm eigentlich kein Problem. W\xE4re da nicht ein Rauschen auf 2m / 70 cm auf dem Fichtelberg von S7. Leise Signale h\xF6rt man nicht - doof bei so einer H\xF6he.</p><p>Aber mit Kurzwelle kann man ja mit FT8 auff\xFCllen.</p><p>Am Ende standen dann 25 UKW QSO und 40 KW QSO im Log. Besonders habe ich mich \xFCber 4 - 23 cm FM gefreut.</p><p>Auch Christiane hat auf 2 &amp; 70 cm ihre ersten POTA Aktivierungen ( 2 fer ) geschafft. Und war so angefixt das wir am Tag drauf gleich vom Sauberg den n\xE4chsten 2 fer aktiviert haben.</p><p>vy 73 Christiane DN9CH &amp; Gerd DL2EGS</p><p><img src="'+T+'" alt="Bilder des Monats"><img src="'+z+'" alt="Bilder des Monats"><img src="'+P+'" alt="Bilder des Monats"><img src="'+F+'" alt="Bilder des Monats"><img src="'+O+'" alt="Bilder des Monats"><img src="'+N+'" alt="Bilder des Monats"><img src="'+L+'" alt="Bilder des Monats"><img src="'+H+'" alt="Bilder des Monats"></p><p>Erstaktivierung von DE-0829 Liether Geh\xF6lz und Rosengarten Elmshorn</p><p>Am 22.09.2024 einem sonnigen Sonntag ging Tom DO7PX in dem erst vor kurzem neu eingetragenen Park Liether Geh\xF6lz und Rosengarten in Elmshorn. Es hat einen kurzen Moment gedauert bis ein passender Spot gefunden war. Die ersten 10 Kontakte waren in weniger als einer halben Stunde zusammen, das war einer Rekord f\xFCr Tom. Beim letzten aktivierten Park hat es 2 Stunden gedauert.</p><p><img src="'+C+'" alt="Bilder des Monats"><img src="'+W+'" alt="Bilder des Monats"><img src="'+K+'" alt="Bilder des Monats"></p><p>DL4DP: Mit dem Fahrrad nach Belgien. Ich habe BE-0117 und BE-0118 aktiviert. Einen mit FT8 und FT4, den anderen in SSB.</p><p><img src="'+R+'" alt="Bilder des Monats"><img src="'+Q+'" alt="Bilder des Monats"><img src="'+V+'" alt="Bilder des Monats"><img src="'+x+'" alt="Bilder des Monats"><img src="'+I+'" alt="Bilder des Monats"><img src="'+G+'" alt="Bilder des Monats"><img src="'+U+'" alt="Bilder des Monats"><img src="'+q+'" alt="Bilder des Monats"></p><p>Meine 1. POTA-Aktivierung in DE-0192 im Saarland Zusammen mit DK8YS, DM1FF und DB6LX Danke f\xFCr den Support Jungs. 73 de DA6TW</p><p><img src="'+X+'" alt="Bilder des Monats"><img src="'+Y+'" alt="Bilder des Monats"><img src="'+Z+'" alt="Bilder des Monats"></p><p>DB4LL und DB6NL haben am Abend einmal DE-0830 auf 10m mit einer Moxon und 50W in SSB aktiviert. Im Log landeten 2x USA, 2x Kanada und 3x Chile.</p><p><img src="'+y+'" alt="Bilder des Monats"></p><p>Christiane\u2018s erstes QSO auf 10m. Gleich mit \u201EViele Elche\u201C ( Canada )</p><p>Erst ein paar QSO vom K\xF6nig Albert Turm ( Spiegelwald - Berg ) wieder ein paar auf 23cm.</p><p>Danach sind wir zum Bergwerk ( Museum ) am Sauberg. 705 mit MC-750 ist in ein paar Minuten aufgebaut.</p><p>Meine &gt; 10 QSO sind in FT8/FT4 in gut 1 h im Log.</p><p>Leider klappt nur 10m bei Christiane nicht so gut. Es bleibt bei 6 QSO.</p><p>Schade aber bestimmt nicht der letzte 10m POTA Versuch.</p><p>vy 73 Christiane DN9CH und Gerd DL2EGS</p><p><img src="'+J+'" alt="Bilder des Monats"><img src="'+$+'" alt="Bilder des Monats"><img src="'+ee+'" alt="Bilder des Monats"><img src="'+te+'" alt="Bilder des Monats"></p><p>DE-0040 Erzgebirge Vogtland Nature Park &amp; DE-0683 Schwarzwassertal National Nature Reserve</p><p>Diesmal leider nur auf 30&amp;20m FT8 QSO m\xF6glich. Daf\xFCr klappte 30m richtig klasse - UKW leider nur 2 direkt QSO.</p><p><img src="'+ae+'" alt="Bilder des Monats"><img src="'+ie+'" alt="Bilder des Monats"><img src="'+re+'" alt="Bilder des Monats"><img src="'+ne+'" alt="Bilder des Monats"><img src="'+se+'" alt="Bilder des Monats"><img src="'+oe+'" alt="Bilder des Monats"></p><p>Aktivierung DE-0830 Ruhrtalradweg</p><p>Bei wechselhaftem Herbstwetter mit k\xFChlen Temperaturen, Schauern und teils starken Windb\xF6en aktivierte DO8PHK den Ruhrtalradweg in der Ruhrschleife in Oberhausen-Altstaden. Die ersten 10 erforderlichen Kontakte waren per FT4 und FT8 auf 10m und 15m schnell geloggt. Es folgten 3 weitere SSB-QSOs, eines davon sogar als Park to Park-QSO mit DC8CH, der zur gleichen Zeit den Landschaftspark Duisburg-Nord (DE-0146) aktivierte.</p><p><img src="'+de+'" alt="Bilder des Monats"><img src="'+pe+'" alt="Bilder des Monats"><img src="'+_e+'" alt="Bilder des Monats"><img src="'+le+'" alt="Bilder des Monats"></p><p>POTA Aktivierung DE-0192 und DE-0744 von DK8YS und DA6TW. Trotz des einsetzenden Regen haben wir die Aktivierung noch geschafft.</p><p><img src="'+me+'" alt="Bilder des Monats"><img src="'+ge+'" alt="Bilder des Monats"><img src="'+ce+'" alt="Bilder des Monats"><img src="'+he+'" alt="Bilder des Monats"><img src="'+ue+'" alt="Bilder des Monats"><img src="'+ve+'" alt="Bilder des Monats"><img src="'+Be+'" alt="Bilder des Monats"></p>',36),xt={href:"https://www.qrz.com/db/DK1BOU",target:"_blank",rel:"noopener noreferrer"},It=e("DK1BOU"),Gt=e(": 1st Activation von "),Ut={href:"https://pota.app/#/park/de-0839",target:"_blank",rel:"noopener noreferrer"},qt=e("DE-0839, M\xE4rchenstra\xDFe"),Xt=e(". Der See hat sich sehr gut als Radial gemacht. Die Antennenaufbauten wurden auch fachm\xE4nnisch von der Ente abgenommen und genehmigt. 31 QSOs, 2x P2P und 1x DX in 1h auf 40/20/15m SSB."),Yt=r('<p><img src="'+ke+'" alt="Bilder des Monats"><img src="'+Me+'" alt="Bilder des Monats"><img src="'+De+'" alt="Bilder des Monats"><img src="'+fe+'" alt="Bilder des Monats"><img src="'+be+'" alt="Bilder des Monats"><img src="'+we+'" alt="Bilder des Monats"></p><p>DK9CA: Ich konnte endlich wieder eine Aktivierung machen. Es wurde weiter am &quot;Kilo&quot; gefeilt: Von DE-0121 aus kamen 57 QSO auf 15m, 20m und 40m ins Logbuch. Davon waren 7 P2P, etliche DF2DF &amp; 3 Verbindungen auf 15m gingen nach Nordamerika.</p><p>Mit dem FT-891 wieder Solo und dem Heil Sound BM-17 DS das erste mal per VOX aktiviert. Die Plexiglas-EFHW performte wieder wie ein Champ und ich hatte eine Menge Spa\xDF wie lange nicht mehr. Ich habe in 2 1/4 Stunden den 18Ah Eremit-Akku komplett &quot;leergefunkt&quot;.</p><p>Der 10Ah Akku wurde am Solarpanel w\xE4hrenddessen aufgeladen und bescherte mir dann als Backup die letzten 3 QSO nach denen ich dann gl\xFCcklich wieder zu Frau &amp; Kindern fuhr.</p><p><img src="'+je+'" alt="Bilder des Monats"><img src="'+Se+'" alt="Bilder des Monats"><img src="'+Ae+'" alt="Bilder des Monats"><img src="'+Ee+'" alt="Bilder des Monats"><img src="'+Te+'" alt="Bilder des Monats"><img src="'+ze+'" alt="Bilder des Monats"></p>',5),Zt=e("Um in 2024 alle 33 POTA-Referenzen in Hamburg zu aktivieren, d\xFCrfen nat\xFCrlich nicht die Parks auf der 120km vom Stadtgebiet entfernten, aber zu Hamburg geh\xF6renden Insel Neuwerk fehlen. So hat sich DC1TC f\xFCr ein Wochenende auf die Insel begeben, um "),yt={href:"https://pota.app/#/park/DE-0133",target:"_blank",rel:"noopener noreferrer"},Jt=e("DE-0133"),$t=e(" Insel Neuwerk und "),ea={href:"https://pota.app/#/park/DE-0104",target:"_blank",rel:"noopener noreferrer"},ta=e("DE-0104"),aa=e(" Hamburgisches Wattenmeer zu aktivieren. Auf 70cm/2m/15m/20m/40m kamen 103 QSOs (+n-fer P2Ps) zustande, mit einer gro\xDFen Anzahl an DF2DF- und P2P-Verbindungen."),ia=r('<p><img src="'+Pe+'" alt="Bilder des Monats"><img src="'+Fe+'" alt="Bilder des Monats"><img src="'+Oe+'" alt="Bilder des Monats"><img src="'+Ne+'" alt="Bilder des Monats"><img src="'+Le+'" alt="Bilder des Monats"><img src="'+He+'" alt="Bilder des Monats"><img src="'+Ce+'" alt="Bilder des Monats"></p><p>3 Aktivierung in drei L\xE4ndern an einem Tag mit dem Fahrrad.</p><p>NL-0018 BE-0117 DE-0055</p><p>Die Radtour war ca. 125 km lang.</p><p>Es ging von Deutschland in die Niederlande wo die erste Aktivierung in SSB mit 5 Watt erfolgt und dann nach Belgien. Auch in Belgien wurde in SSB gearbeitet.</p><p>Die R\xFCckfahrt erfolgt von Belgien \xFCber die Niederlande nach Deutschland.</p><p>In Deutschland wurde die Aktivierung in FT8 und FT4 durchgef\xFChrt.</p><p>Rufzeichen im Rahmen der 3 Aktivierungen.</p><p>DL4DP/P PA/DL4DP/QRP ON/DL4DP/QRP</p><p><img src="'+We+'" alt="Bilder des Monats"><img src="'+Ke+'" alt="Bilder des Monats"><img src="'+Re+'" alt="Bilder des Monats"><img src="'+Qe+'" alt="Bilder des Monats"><img src="'+Ve+'" alt="Bilder des Monats"><img src="'+xe+'" alt="Bilder des Monats"><img src="'+Ie+'" alt="Bilder des Monats"><img src="'+Ge+'" alt="Bilder des Monats"><img src="'+Ue+'" alt="Bilder des Monats"><img src="'+qe+'" alt="Bilder des Monats"></p>',10);function ra(na,sa){const a=d("ExternalLinkIcon");return s(),o("div",null,[Ye,Ze,ye,Je,t("p",null,[$e,t("a",et,[tt,i(a)]),at]),it,t("p",null,[rt,t("a",nt,[st,i(a)]),ot,t("a",dt,[pt,i(a)]),_t,t("a",lt,[mt,i(a)]),gt,t("a",ct,[ht,i(a)]),ut]),vt,t("p",null,[Bt,t("a",kt,[Mt,i(a)]),Dt,t("a",ft,[bt,i(a)]),wt,t("a",jt,[St,i(a)]),At,t("a",Et,[Tt,i(a)]),zt,t("a",Pt,[Ft,i(a)]),Ot,t("a",Nt,[Lt,i(a)]),Ht,t("a",Ct,[Wt,i(a)]),Kt,t("a",Rt,[Qt,i(a)])]),Vt,t("p",null,[t("a",xt,[It,i(a)]),Gt,t("a",Ut,[qt,i(a)]),Xt]),Yt,t("p",null,[Zt,t("a",yt,[Jt,i(a)]),$t,t("a",ea,[ta,i(a)]),aa]),ia])}var da=n(Xe,[["render",ra],["__file","2024-09-30-Bilder-Des-Monats-September.html.vue"]]);export{da as default};
